import { Link } from "react-router-dom";

import Classes from "./MainNavigation.module.css";

const MainNavigation = () => {
  return (
    <header>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/products">Product</Link>
        </li>
      </ul>
    </header>
  );
};
export default MainNavigation;
